script: |
  super -f text -I q11343.spq | sort > q11343.out

inputs:
  - name: q11343.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE col2 NOT BETWEEN - - col1 * - + col0 * - 14 AND + col2 * + col1 + - col2;
  - name: tab2

outputs:
  - name: q11343.out
    data: |
      46	51	23
      64	77	40
      75	67	58
